    public static List createOrderOC(ImportOrderOC importOrderOnChain) throws JsonProcessingException {
        List<String> args = new ArrayList<>();
        args.add(importOrderOnChain.getOrderId());
        args.add(importOrderOnChain.getCreateTime());
        args.add(importOrderOnChain.getImportType());
        args.add(importOrderOnChain.getContractId());
        args.add(importOrderOnChain.getClientName());
        args.add(importOrderOnChain.getLoadingPort());
        args.add(importOrderOnChain.getDestinationPort());
        args.add(importOrderOnChain.getBusinessGroupId());
        args.add(importOrderOnChain.getTenantId());
        args.add(importOrderOnChain.getOrderDigest());
        FunctionResult functionResult = xuperChainWrapper.send(abi, contractName, null, "createOrder", args, false, null, false);
        System.out.println("----" + functionResult.result);
        System.out.println("----" + functionResult.transactionHash);
        return functionResult.result;

    }

